7-Strand Paracord 550 Type-III 100FT Neon Yellow<br><br>

7ストランドの550 Type-III規格のパラシュートコードです。<br><br>

とてもしなやかで強靭な秘密は７ストランドの構造だから。<br>
切り口を見ると、さらに細く編み込まれた７本の細いヒモが出てきます、これが７ストランド構造で、これによりしなやかな触感に加えて高張力で伸びにくく、高い荷重性能を発揮します。<br><br>

ナイロン100％構造なので水による変質にも強く、安定した性能が有ります。<br><br>

・直径：約4mm<br>
・長さ：100フィート(約30m)<br><br><style>

