アメリカのメーカーALTA社（アルタ社）のニーパッドはスタンダードなハードシェルタイプですが、ヒザを包み込む様なシェル形状＆しなやかな質感の硬質ラバーが自然な使用感とグリップ感を生み出し、安定した快適な接地姿勢をサポート、腰の負担も軽減します。<br><br>

・抜群なシェル形状と適度なグリップ<br>
ALTAだけの包み込むようなシェル形状で接地時の安定感と、素材所以のグリップ感で自然な使用感があります。<br><br>

・シェルリベット固定<br>
このシェルは６カ所の金属製リベットでしっかりと固定されていますので高い耐久性があります。<br><br>

・適度なクッション性能<br>
シェルの内側とヒザの接地面の間には約1.3センチの高密度フォームと低反発フォームが内蔵されております。<br><br>

・追従性と簡単着脱<br>
3角形のALTALOK (アルタロック) クイックリリースバックルシステムを採用しており簡単な着脱と、この部分が上下にピボットすることでヒザの動きに追従し使用感がとても自然なのが特徴。<br><br>

・上下異素材ストラップと広い調節幅<br>
上のストラップが伸縮性のあるラバーストラップ、下が伸縮しないナイロンのストラップを採用。<br>
幅は共に約４cmで同じですが異素材のコンビネーションにより「へたり」が少なくがっちりと固定出来ます。<br><br>

さらに裏側にサイズ調整の為のベルクロを使用していないので、ストラップが柔らかくヒザを曲げた時にもヒザ裏への「食い込み」が最小限なのも特徴です。
長さ調節はALTALOK部で行うので無段階調整が可能で、余ったストラップをベルクロでまとめられます。<br><br>

・パッド部、シェル部共にブラウン色が強いコヨーテブラウン色です。<br><br>

ハードシェルタイプでより良い使用感をお求めの方へおすすめです。<br><br>

・全長：約24cm<br>
・シェル部全長：約18センチ<br>
・重量：約380g（ペアで計測）<br>
・サイズ：フリーサイズ<br>
・原産国：メキシコ<br><br>

<font color="FF0000">※左右は「同形状」のペアーがセットです。<br><br>

※今回の入荷分は改良され余ったストラップをまとめるベルクロが追加されています。<br><br>

※入荷時期により画像と異なる場合がございます、予めご了承ください。</font><br><br><style>

